import classes from './SalePage.module.sass'
import CommodityBlock from "../../components/CommodityBlock/CommodityBlock";
import {useParams} from "react-router-dom";
import {useEffect, useState} from "react";

const SalePage = () => {

    const page = useParams()
    const [namePage, setNamePage] = useState('')
    useEffect(() => {
        enterNamePage(page)
    }, [page])

    console.log(namePage)
    const enterNamePage = (str) => {
        switch (str) {
            case 'hydro':
                setNamePage('Гидроциклы')
                console.log(str.category)

            case'boats':
                setNamePage('Лодки')

        }


    }
    return (
        <div className={classes.salePage}>
            <div className={classes.saleHeader}>
                <h2>{page.category}</h2>
                <div className={classes.linkBlock}>
                    <a>Полноприводные</a>
                    <a>от 5000</a>
                    <a>BRP</a>
                    <a>еще</a>
                </div>
            </div>
            <div className={classes.mainBlock}>
                <div className={classes.filter}></div>
                <CommodityBlock/>
            </div>
            <div className={classes.pageCounter}>
                <p className={classes.active}>1</p>
                <p>2</p>
                <p>3</p>
                <p>4</p>
                <p>5</p>
            </div>
        </div>
    )

}

export default SalePage
